import { NavBar } from "../components/NavBar";
import { RechargeItem } from "../components/RechargeItem";

export default function ListeDemande(){
    const liste = [
        {
            client:"Idealy",
            solde:200
        },
        {
            client:"Rojo",
            solde:200
        },
        {
            client:"Mamy",
            solde:500
        }, 
        {
            client:"Aina",
            solde:600
        },
    ];
    return (
        <div>
            <NavBar/>
            <div className="container">
                <div>
                    <h1>Liste des demandes</h1>
                    <div className="row">
                        {liste?.map((value)=><RechargeItem valeur={value} />)}
                    </div>
                </div>
            </div>
        </div>
    )
}
